import { Component } from "react";
import Title from './title';

export default class Search extends Component {
    render() {
        return (
            <div class="search Glass-plate right-top">
                <Textfield name="password" type="password" icon="https://img.icons8.com/ios-filled/50/ffffff/key-security.png" cont="password" />
                <img class={"icon " + this.props.align} src={this.props.src} onClick={this.props.click} />
            </div>
        );
    }
}
